#include <bits/stdc++.h>
using namespace std;
long long myhash(string s){
    long long ret=0;
    long long pow=1;
    for(long long i=0;i<s.length();i++){
        ret+=(s[i]-'0')*pow;
        pow*=74;
    }
    return ret;
}
long long n;
vector <long long> v;
bool exist(long long num){
    for(int i=0;i<v.size();i++){
        if(v[i]==num){
            return true;
        }
    }
    return false;
}
int main(){
    cin>>n;
    string s;
    while(n--){
        cin>>s;
        long long h=myhash(s);
        if(!exist(h)){
            v.push_back(h);
        }
    }
    cout<<v.size();
    return 0;
}
